  "We collect and use your Personal Data with your consent to provide, maintain, and develop our products and services and understand how to improve them.": "We collect and use your Personal Data with your consent to provide, maintain, and develop our products and services and understand how to improve them.",
  "These purposes include:": "These purposes include:",
  "To deliver your product or service\n                  To fulfill orders including electronic and non-electronic shipment\n                  Building a Safe and Secure Environment\n                  To verify or authenticate your identity; and\n                  Investigate and prevent security incidents such as breaches, attacks and hacks": "To deliver your product or service\n                  To fulfill orders including electronic and non-electronic shipment\n                  Building a Safe and Secure Environment\n                  To verify or authenticate your identity; and\n                  Investigate and prevent security incidents such as breaches, attacks and hacks",
  "Providing, Developing, and Improving our Products and Services\n                  Deliver, maintain, debug and improve our products and services.\n                  Enable you to access Time Space Ventures Pvt. Ltd. services and set up accounts.\n                  Provide you with technical and customer support\n                  Where we process your Personal Data to provide a product or service, we do so because it is necessary to perform contractual obligations. All of the above processing is necessary in our legitimate interests to provide products and services and to maintain our relationship with you and to protect our business for example against fraud. Consent will be required to initiate services with you. New consent will be required if any changes are made to the type of data collected. Within our contract, if you fail to provide consent, some services may not be available to you.": "Providing, Developing, and Improving our Products and Services\n                  Deliver, maintain, debug and improve our products and services.\n                  Enable you to access Time Space Ventures Pvt. Ltd. services and set up accounts.\n                  Provide you with technical and customer support\n                  Where we process your Personal Data to provide a product or service, we do so because it is necessary to perform contractual obligations. All of the above processing is necessary in our legitimate interests to provide products and services and to maintain our relationship with you and to protect our business for example against fraud. Consent will be required to initiate services with you. New consent will be required if any changes are made to the type of data collected. Within our contract, if you fail to provide consent, some services may not be available to you.",
  "International Data Transfer and Storage": "International Data Transfer and Storage",
  "Where possible, we store and process data on servers within the general geographical region where you reside (note: this may not be within the country in which you reside). Your Personal Data may also be transferred to, and maintained on, servers residing outside of your state, province, country or other governmental jurisdiction where the data laws may differ from those in your jurisdiction. We will take appropriate steps to ensure that your Personal Data is treated securely and in accordance with this Policy as well as applicable data protection law. More information about these clauses can be found here:": "Where possible, we store and process data on servers within the general geographical region where you reside (note: this may not be within the country in which you reside). Your Personal Data may also be transferred to, and maintained on, servers residing outside of your state, province, country or other governmental jurisdiction where the data laws may differ from those in your jurisdiction. We will take appropriate steps to ensure that your Personal Data is treated securely and in accordance with this Policy as well as applicable data protection law. More information about these clauses can be found here:",
