  "3. Cookies": "3. Cookies",
  "What are Cookies?": "What are Cookies?",
  "A cookie is a small file with information that your browser stores on your device. Information in this file is typically shared with the owner of the site in addition to potential partners and third parties to that business. The collection of this information may be used in the function of the site and/or to improve your experience.": "A cookie is a small file with information that your browser stores on your device. Information in this file is typically shared with the owner of the site in addition to potential partners and third parties to that business. The collection of this information may be used in the function of the site and/or to improve your experience.",
  "How we use cookies": "How we use cookies",
  "To give you the best experience possible, we use the following types of cookies:": "To give you the best experience possible, we use the following types of cookies:",
  "Strictly Necessary. As a web application, we require certain necessary cookies to run our service.": "Strictly Necessary. As a web application, we require certain necessary cookies to run our service.",
  "Preference. We use preference cookies to help us remember the way you like to use our service.": "Preference. We use preference cookies to help us remember the way you like to use our service.",
