  "We require any third party who is contracted to process your Personal Data on our behalf to have security measures in place to protect your data and to treat such data in accordance with the law.": "We require any third party who is contracted to process your Personal Data on our behalf to have security measures in place to protect your data and to treat such data in accordance with the law.",
  "In the unfortunate event of a Personal Data breach, we will notify you and any applicable regulator when we are legally required to do so.": "In the unfortunate event of a Personal Data breach, we will notify you and any applicable regulator when we are legally required to do so.",
